script: |
  super -f tsv -I q3326.sql | sort > q3326.out

vector: true

inputs:
  - name: q3326.sql
    data: |
      SELECT ALL - CAST ( NULL AS INTEGER ) * + + MAX ( 1 ) AS col1, + CASE + 51 WHEN + 75 THEN NULL WHEN + COUNT ( * ) * + 98 * 5 * - CAST ( NULL AS INTEGER ) THEN + - 68 * + 35 - + 59 * + 89 + 4 * - + COUNT ( * ) ELSE NULLIF ( + 39, - + 76 * - 11 * + 14 ) END AS col0;

outputs:
  - name: q3326.out
    data: |
      NULL	39
